export const fetchUserProfile = () => {
    let token = localStorage.getItem('accesstoken')


    fetch("/user/profile", {
        method: "GET",
        headers: {
            'Content-Type': 'application/json',
            Accept: 'application/json',
            'Authorization': `${token}`
        }
    })
}
